import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Link, Outlet, useNavigate } from 'react-router-dom';
import Page from './Page';

function Home() {
    const navigate = useNavigate();

    const handleButtonClick = () => {
        // Używamy `navigate` zamiast `history.push` do programowego przekierowania do trasy "/strona"
        navigate('/strona');
    };

    return (
        <div>
            <button onClick={handleButtonClick}>Kliknij mnie</button>
        </div>
    );
}

function App() {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/xd" element={<Page>XDDD</Page>} />
                <Route path="/strona2" element={<Page>Strona 2</Page>} />
            </Routes>
        </Router>
    );
}


export default App;
